import {
  Button,
  FormControl,
  InputLabel,
  MenuItem,
  Select,
  TextField,
  Typography,
} from "@mui/material";
import { Field, Form, Formik } from "formik";
import React from "react";
import { useNavigate } from "react-router-dom";
const initialValues = {
  fullName: "",
  email: "",
  password: "",
  role: "",
};
const RegisterForm = () => {
  const Navigate = useNavigate();
  const handleSubmit = () => {
    // Navigate("/account/login");
  };
  return (
    <div>
      <Typography variant="h5" className="text-center">
        login
      </Typography>
      <Formik initialValues={initialValues} onSubmit={handleSubmit}>
        <Form>
          <Field
            as={TextField}
            name="fullName"
            label="full Name"
            fullWidth
            margin="normal"
          />
          <Field
            as={TextField}
            name="email"
            label="email"
            fullWidth
            margin="normal"
          />
          <Field
            as={TextField}
            name="password"
            label="password"
            fullWidth
            margin="normal"
          />

          <InputLabel id="role-simple-select-label">Role</InputLabel>
          <Field
            fullWidth
            margin="normal"
            labelId="role-simple-select-label"
            id="role-simple-select"
            label="Role"
          >
            <MenuItem value={10}>ROLE_CUSTOMER</MenuItem>
            <MenuItem value={20}>RESTAURANT_OWNER</MenuItem>
          </Field>

          <Button
            fullWidth
            type="submit"
            variant="contained"
            className=""
            sx={{ mt: 2, padding: "1rem" }}
          >
            login
          </Button>
        </Form>
      </Formik>
      <Typography variant="body2" align="center" sx={{ mt: 3 }}>
        if have an Account already
        <Button onClick={() => Navigate("/account/login")} size="small">
          Register
        </Button>
      </Typography>
    </div>
  );
};

export default RegisterForm;
